/**
 * Gets the hostID attribute of the HostInfo object
 *
 * @param hostName  Description of the Parameter
 * @return          The hostID value
 */
public HostInfo getHostInfo(String hostName)
{
    HostInfo hi = (HostInfo)hosts.get(hostName);
    if(hi == null)
    {
        return put(hostName);
    }
    return hi;
}

